import React from "react";

function SearchForm(props) {
    return(
        <div id="searchContainer">
            <h3>Book Search</h3>
            <form id="bookSearch">
                <label form="bookSearch">Enter a book to search:</label>
                <br></br>
                <input type="text" name="bookSearch" id="searchTerm" form="bookSearch" placeholder="Book Title" required/>
                <br></br>
                <button type="submit" onClick={() => props.handleSearchClick()}>Search</button>
            </form>
        </div>
    );
}

export default SearchForm;
